import React from 'react';
import ImageUploader from './components/ImageUploader.js';
import BackgroundPreview from './components/BackgroundPreview';
import './styles/app.css';

function App() {
  return (
    <div className="App">
      <h1>Image Background Changer</h1>
      <ImageUploader />
      <BackgroundPreview />
    </div>
  );
}

export default App;
